import React from 'react';
import { useParams } from 'react-router-dom';
import CustomButton from '../components/CustomButton';
import './ProductPage.css';
import products from '../../data/products';

const ProductPage = () => {
  const { productId } = useParams();
  const product = products.find(p => p.id === Number(productId));

  if (!product) {
    return <div className="error">Товар не найден</div>;
  }

  return (
    <div className="product-page-container">
      <div className="product-main-content">
        {/* Левая колонка: только изображение */}
        <div className="product-left-column">
          <img
            src={product.image}
            alt={product.model}
            className="product-main-image"
          />
        </div>

        {/* Правая колонка: название, характеристики и цена с кнопкой */}
        <div className="product-center-column">
          <div className="product-details">
            {/* Левая часть: название и характеристики */}
            <div className="product-info">
              <h1 className="product-title">
                {product.model} {product.memory}
              </h1>

              <div className="product-specs">
                <h3>Характеристики</h3>
                <div className="specs-grid">
                  <div className="spec-item">
                    <span className="spec-title">Экран</span>
                    <span className="spec-value">{product.specs.screen}</span>
                  </div>
                  <div className="spec-item">
                    <span className="spec-title">Количество ядер</span>
                    <span className="spec-value">{product.specs.cores}</span>
                  </div>
                  <div className="spec-item">
                    <span className="spec-title">Мощность блока питания</span>
                    <span className="spec-value">{product.specs.power}</span>
                  </div>
                  <div className="spec-item">
                    <span className="spec-title">Оперативная память</span>
                    <span className="spec-value">{product.specs.ram}</span>
                  </div>
                  <div className="spec-item">
                    <span className="spec-title">Встроенная память</span>
                    <span className="spec-value">{product.specs.storage}</span>
                  </div>
                  <div className="spec-item">
                    <span className="spec-title">Основная камера</span>
                    <span className="spec-value">{product.specs.camera}</span>
                  </div>
                </div>
              </div>
            </div>

            {/* Правая часть: цена и кнопка */}
            <div className="price-section">
              <div className="product-price">
                {product.newPrice.toLocaleString()} BYN
              </div>
              <CustomButton className="add-to-cart-btn">
                Добавить в корзину
              </CustomButton>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ProductPage;
